import React from "react";
import Footer from "./components/Footer";
// import { useState } from "react";
import { BrowserRouter as Router, Route, NavLink } from "react-router-dom";
import AboutPage from "./components/About";
import PortfolioPage from "./components/Portfolio";
import ContactPage from "./components/Contact";


function Header(){
  return (
  <nav className="navbar navbar-expand-lg navbar-light bg-light">
      <NavLink className="navbar-brand" to="/">Michael J. O'Connor</NavLink>
      <div>
        <ul className="navbar-nav">
          <li className="nav-item">
            <NavLink to="/" className="nav-link" activeClassName="active">About</NavLink>
          </li>
          <li className="nav-item">
            <NavLink to="/discover" className="nav-link" activeClassName="active">Portfolio</NavLink>
          </li>
          <li className="nav-item">
            <NavLink to="/search" className="nav-link" activeClassName="active">Publications</NavLink>
          </li>
          <li className="nav-item">
            <NavLink to="/search" className="nav-link" activeClassName="active">Contact</NavLink>
          </li>
        </ul>
      </div>
    </nav>
  )
}

function App() { 

  // html
  return (
    <>
      <Router> 
        <Header />
        <Route exact path={["/","/About"]} component={AboutPage} />
        <Route exact path="/Portfolio" component={PortfolioPage} />
        <Route exact path="/Publications" component={PublicationsPage} />
        <Route exact path="/Contact" component={ContactPage} />
      </Router>
      <Footer />
    </>
  );
}

export default App;
